INSERT INTO `df_drawing_example` VALUES (1726901517456252956, 0, '2023-11-21 17:53:01', '2023-11-21 17:53:01', 'https://cdn.midjourney.com/97e61346-868f-4569-be36-32f124de38ed/0_0.webp', 'https://cdn.midjourney.com/97e61346-868f-4569-be36-32f124de38ed/0_0_384_N.webp', 'Design a Vtuber character named \"Terra\" for the students of TEB Edukacja. Terra should appear around 20 years old with a medium height. She should have fair skin with blue digital accents, long silver-blue hair with green highlights tied in a loose bun. Her eyes should be large and electric blue with digital details. Terra\'s outfit should have a modern, cyberpunk feel, incorporating the TEB Edukacja logo on her jacket and shoes. Accessorize her with: A small backpack shaped like a book with the TEB Edukacja logo. Headphones with a microphone that has the TEB logo on the side. Gloves with LED lights and printed circuit designs. Terra is energetic, helpful, and friendly, always ready to support TEB Edukacja students in their educational journey. She uses humor to make learning engaging and can explain complex topics simply. She occasionally switches modes, like a debugging mode, where her appearance and voice might alter slightly. Terra\'s companion is a small robot named \"Bit\", which provides her with trivia and facts, communicating through short, animated text messages. Terra\'s backstory is that she was created in the virtual world of TEB Edukacja as a digital ambassador for education. Her primary goal is to assist students in grasping the fundamentals of technology and preparing for exams. Although from a digital realm, she\'s programmed to understand human emotions and needs. She\'s driven to inspire students to continuously learn and enhance their skills. photorealistic, 8k, unreal enging', 20192582, 1687012973309075458, 'N', '535dbbab-96c2-4a41-a5cf-7bd67271063e', 'SYS');
