INSERT INTO `df_drawing_example` VALUES (1726902694306652188, 0, '2023-11-21 17:57:41', '2023-11-21 17:57:41', 'https://cdn.midjourney.com/cef47334-dc66-4c31-b24b-0cedeecc739c/0_0.webp', 'https://cdn.midjourney.com/cef47334-dc66-4c31-b24b-0cedeecc739c/0_0_384_N.webp', 'Luh Tyler, the animated rapper, bursts with charisma and creativity. Sporting a distinctive urban streetwear ensemble infused with eclectic accessories, he\'s a dynamic character with a signature messy yet stylish hairstyle--colorful dreadlocks and braids that match his vivid personality. His expressive eyes convey his passion for music, while his infectious smile and signature hats add a playful touch. Onstage, he commands attention, microphone in hand, as he sways to the rhythm, radiating confidence with his outstretched arms. Electric blue, neon green, and hot pink dominate his vibrant color palette, and he\'s often depicted against a backdrop of graffiti art and vibrant patterns. Luh Tyler\'s cartoon character encapsulates the essence of a fearless rapper, merging musical prowess with a truly unique visual style.', 19462727, 1687012973309075458, 'N', '69c39866-5d47-4a1b-a21e-8b0789b185de', 'SYS');
