INSERT INTO `df_drawing_example` VALUES (1726978473349615647, 0, '2023-11-21 22:58:48', '2023-11-21 22:58:48', 'https://cdn.midjourney.com/9a985588-476b-43b3-8d49-082b53b51841/0_0.webp', 'https://cdn.midjourney.com/9a985588-476b-43b3-8d49-082b53b51841/0_0_384_N.webp', 'A simple low-poly 3D cartoon human base mesh modeled in Blender, rendered from multiple angles as reference. It has basic shapes including a spherical head, cylindrical limbs, and a blocky torso. Provide front, side, and 3/4 views. The model has proper edge flow and quad-based topology optimized for rigging and animation. A basic skeletal armature is visible inside the mesh. There is soft ambient lighting with a plain white background. Export sharp 4K images from multiple angles for use as modeling reference when recreating this base humanoid form in Blender for further customization.\" Key elements: Specifies low-poly, simple shapes for head, limbs and torso Requests multiple angles: front, side, 3/4 views Notes proper edge flow and quad topology for animation Includes basic inner armature/skeleton Soft ambient lighting on white background 4K sharp images for Blender modeling reference Mentions customizing the base humanoid further', 19555211, 1687012973309075458, 'N', '05f2722e-406a-45d1-9f0a-febf7ae80349', 'SYS');
INSERT INTO `df_drawing_example` VALUES (1726978473349615648, 0, '2023-11-21 22:58:48', '2023-11-21 22:58:48', 'https://cdn.midjourney.com/c4dede6f-e077-458f-ad6c-3d1e88071872/0_0.webp', 'https://cdn.midjourney.com/c4dede6f-e077-458f-ad6c-3d1e88071872/0_0_384_N.webp', 'Here is an improved Midjourney prompt based on the rigging overview provided: \"A step-by-step visual guide to rigging a realistic 3D animated rapper cartoon character in Blender. Show the rapper character in multiple angles - front, side, 3⁄4 views. Illustrate preparing the topology-optimized base mesh. Create the armature inside showing the spine, neck, head, arm, hand, leg and foot bones in anatomical positions. Visualize bone constraints for realistic motion. Demonstrate weight painting influence. Include facial rig with controls for expressions. Show the posing and animation process with the completed professional grade rig. Use color-coded bones overlayed on the character mesh. Create an instructive style with vivid lighting and shading. Export 4K sharp images for a Blender animation tutorial.\" Key improvements: - Specifies step-by-step visual guide format - Requests multiple character angles for reference - Calls out topology-optimized base mesh - Names specific bones to include - Mentions bone constraints and weight painting - Includes facial rig and expressions - Describes posing and animation with completed rig - Color-coded bones overlaid on mesh - Instructive style with vivid shading - 4K sharp images optimized for tutorial Let me know if you would like me to modify or refine this further. The goal is generating clear visual references for a rigging tutorial tailored to a hip hop cartoon character.', 19553962, 1687012973309075458, 'N', '026a1d46-cc1e-476d-a2bb-c343684a5d6e', 'SYS');
