INSERT INTO `df_drawing_example` VALUES (1726979592901627937, 0, '2023-11-21 23:03:15', '2023-11-21 23:03:15', 'https://cdn.midjourney.com/2a89ea5d-2b4b-4ccb-9acc-af212d3d422d/0_0.webp', 'https://cdn.midjourney.com/2a89ea5d-2b4b-4ccb-9acc-af212d3d422d/0_0_384_N.webp', 'the ad features a square-format image with a clean and minimalist design, perfectly suited for Instagram. Against a vibrant and visually appealing background, a confident individual stands at the center, radiating self-assurance. The background consists of a gradient, transitioning from a warm and energizing hue at the top to a cool and calming shade at the bottom. This gradient effect adds depth and visual interest to the ad. The central figure, dressed in stylish attire, showcases a posture that exudes confidence, with a genuine smile on their face. Their body language and facial expression convey a sense of empowerment and success. To enhance the visual impact, subtle elements such as dynamic lines, representing progress and personal growth, emanate from the figure, symbolizing the transformative journey of self-confidence. Overlaying the image, a concise and inspiring headline grabs attention. It could read, \"Unlock Your Potential, Boost Confidence, and Achieve Success.\" The typography is clean, modern, and easy to read, in line with Instagram\'s aesthetic. Accompanying the headline, a simple and concise call-to-action invites viewers to take action. It could say, \"Swipe up to join the coaching program and embark on your journey to self-confidence and success.\" This text encourages viewers to engage with the ad and learn more about the coaching program. The overall design embraces Instagram\'s visual style, with a focus on high-quality imagery and impactful messaging. The ad aims to capture attention within the fast-paced Instagram feed, inspiring users to explore the coaching program and take a step towards transforming their lives.--q 2 --ar 3:4', 20842374, 1687012973309075458, 'N', '62b034c6-d836-4e40-a1e1-8a1b122110f0', 'SYS');
