INSERT INTO `df_drawing_example` VALUES (1726980247078834217, 0, '2023-11-21 23:05:51', '2023-11-21 23:05:51', 'https://cdn.midjourney.com/75228086-f2be-4bf2-ad68-0c585fe06efa/0_0.webp', 'https://cdn.midjourney.com/75228086-f2be-4bf2-ad68-0c585fe06efa/0_0_384_N.webp', 'Erstellen Sie ein umfassendes Logo-Design-Dokument für eine Physiopraxis, die sich auf Physiotherapie und Sporttherapie spezialisiert hat. Das Logo sollte die Farben Rot und Gelb enthalten und die Schlüsselkonzepte \"Rehabilitation\", \"Bewegung\" und \"Mobilisieren\" hervorheben. Das Design sollte modern sein und auf verschiedenen Medien wie einer Webseite und anderen Marketingmaterialien gut funktionieren.', 21037842, 1687012973309075458, 'N', '785b31da-e462-4f1b-8736-fa7f3649b42a', 'SYS');
INSERT INTO `df_drawing_example` VALUES (1726980247078834218, 0, '2023-11-21 23:05:51', '2023-11-21 23:05:51', 'https://cdn.midjourney.com/cda997fc-efe8-4c4c-93c0-c05d53b636a6/0_0.webp', 'https://cdn.midjourney.com/cda997fc-efe8-4c4c-93c0-c05d53b636a6/0_0_384_N.webp', 'Design a captivating logo for the engineering company owned by Diego Carvalhal. The company is known for its expertise in planning, projects, and consulting services. The logo should exude a sense of professionalism, innovation, and competence. Incorporate visual elements that symbolize engineering and strategic planning, such as stylized gears, precise geometric shapes, or artistic renderings of architectural designs. Consider using a color palette that includes shades of blue and green, as these colors often evoke trustworthiness and growth. However, feel free to explore alternative color combinations that convey authority and confidence. Ensure that the company name, \'Diego Carvalhal Engenharia,\' is integrated into the logo in a clear and legible manner. Additionally, if appropriate, you can include a concise tagline related to intelligent planning or shaping the future. Prioritize a design that is sophisticated and timeless, avoiding overly intricate elements that might compromise the logo\'s readability and adaptability across different usage scenarios. Furthermore, please ensure that the MidJourney includes the complete name \'Diego Carvalhal\' in the logo.', 20823024, 1687012973309075458, 'N', 'f4a705e3-1fa1-45ee-8cfd-38a0ce816754', 'SYS');
