INSERT INTO `df_drawing_example` VALUES (1726980277063913493, 0, '2023-11-21 23:05:58', '2023-11-21 23:05:58', 'https://cdn.midjourney.com/7346d5ca-0a04-4b24-af29-08a2c2af545c/0_0.webp', 'https://cdn.midjourney.com/7346d5ca-0a04-4b24-af29-08a2c2af545c/0_0_384_N.webp', 'Design a logo using the exact word \"Moments.\" The logo must consist solely of this word, without any additional illustrations, graphics, or cartoonish features. Utilize a refined and contemporary typeface. Maintain a professional and elegant appearance with a color scheme limited to shades of black, grey, or white. The focus should be on the precise spelling of \"Moments,\" ensuring that each letter is clearly and correctly represented.', 20030505, 1687012973309075458, 'N', 'c6355ac5-c2a3-4318-8614-f57444627d01', 'SYS');
