INSERT INTO `df_drawing_example` VALUES (1726980322165264387, 0, '2023-11-21 23:06:09', '2023-11-21 23:06:09', 'https://cdn.midjourney.com/4b7d8156-c5f8-4f66-8406-3348a6253f49/0_0.webp', 'https://cdn.midjourney.com/4b7d8156-c5f8-4f66-8406-3348a6253f49/0_0_384_N.webp', 'Create a memorable logo for a custom metal building company. The target audience is construction companies and factories, the logo should evoke associations with quality and guarantee. The logo should not contain text and should be suitable for both 3D minting and website page. Inspiration: The logo of \"Zavod - Global\" was liked by the customer. Please develop several logo concepts with different visual elements and design styles, emphasizing metal structures and themes of quality and warranty. Make sure the logos are distinctive and appealing to the target audience. Experiment with metallic textures, strong and clean lines, a sense of stability and reliability. Feel free to use different shapes, symbols and abstract imagery that can be associated with metal designs. Use iconic elements that leave a lasting impression on viewers. Once the logos have been created, present them in a visually appealing way by showing how they look in 3D on the coin and on the website page.', 18586821, 1687012973309075458, 'N', '6c4548e7-5720-40cc-8989-e8191c5bd975', 'SYS');
INSERT INTO `df_drawing_example` VALUES (1726980322165264388, 0, '2023-11-21 23:06:09', '2023-11-21 23:06:09', 'https://cdn.midjourney.com/e95b512a-5407-4ca9-8681-ff0f14a309d2/0_0.webp', 'https://cdn.midjourney.com/e95b512a-5407-4ca9-8681-ff0f14a309d2/0_0_384_N.webp', '\"Building Different Logo using BD, Concept: \"Breaking Boundaries\" Background: The essence of \"Building Different\" is about pushing beyond the ordinary, defying standards, and embracing uniqueness. This philosophy should be distilled into the visual identity of the brand. This could be a subtle crack or a piece that\'s levitating above the rest. Color Palette: Earthy tones, suggesting groundedness, stability, and foundational strength. A bold or metallic hue (gold or silver) for the element that\'s \"different\", indicating its premium, standout nature. Typography: A robust, geometric font that implies strength and reliability. For the word \"Different\", consider a slight tweak – an unexpected curve or elongation, adding a touch of uniqueness. Emotional Feel: The logo should evoke feelings of inspiration, resilience, and determination. It should signal to the viewer that \'Building Different\' is not just a brand, but a way of life. Reference: Think of the traditional structure of Lego blocks, but imagine if one block was made of gold or was floating above the rest.', 18856089, 1687012973309075458, 'N', 'a9f25e90-7445-4996-ab85-89abbc2324ad', 'SYS');
