INSERT INTO `df_drawing_example` VALUES (1726980322165264421, 0, '2023-11-21 23:06:09', '2023-11-21 23:06:09', 'https://cdn.midjourney.com/01913dc7-5b5d-478e-9067-d5dfa483ca06/0_0.webp', 'https://cdn.midjourney.com/01913dc7-5b5d-478e-9067-d5dfa483ca06/0_0_384_N.webp', 'I am seeking a company logo inspired by the letters \"One\". The logo should embody a youthful and modern aesthetic while maintaining a clean and minimalist design. Please ensure that the logo effectively represents the brand and resonates with the young target audience in Cambodia. I prefer a simple color scheme for the logo that exudes a fresh and contemporary vibe. The colors should be harmonious and not overly complex. In terms of typography, I would like a modern and distinctive font that enhances the youthful and professional essence of the brand. Please keep the logo design concise and easily recognizable, even when scaled to different sizes or displayed on various platforms. While designing the logo, consider incorporating subtle elements that can evoke concepts like technology, innovation, or a nod to Cambodian culture. Lastly, make sure the logo stands out and remains visually appealing against different backgrounds. If possible, I\'d appreciate receiving multiple logo variations suitable for various use cases. Thank you very much!', 19191826, 1687012973309075458, 'N', 'c08b2b46-c494-4e3a-9433-6b64176e82d6', 'SYS');
