INSERT INTO `df_drawing_example` VALUES (1726980368889810986, 0, '2023-11-21 23:06:20', '2023-11-21 23:06:20', 'https://cdn.midjourney.com/501ea69e-4df1-4065-a697-fd5f57670455/0_0.webp', 'https://cdn.midjourney.com/501ea69e-4df1-4065-a697-fd5f57670455/0_0_384_N.webp', 'Generate a series of logo design concepts for the company \'Techwan.\' Each concept should incorporate technology-related imagery, such as circuitry, microchips, or futuristic lines, and should feature the company name \'Techwan\' prominently. Experiment with different fonts, colors, and layouts to create a modern and visually appealing logo that conveys innovation and technologydrawing, technological, flat design, reflections fine details complex picture hyper realistic Octane intricate scenery highly detailed HDR', 21036457, 1687012973309075458, 'N', 'e4c3a521-9a4b-4d8b-b213-0abbd4177ba4', 'SYS');
INSERT INTO `df_drawing_example` VALUES (1726980368889810988, 0, '2023-11-21 23:06:20', '2023-11-21 23:06:20', 'https://cdn.midjourney.com/3902afee-1a09-4949-a048-bf51996a8d43/0_0.webp', 'https://cdn.midjourney.com/3902afee-1a09-4949-a048-bf51996a8d43/0_0_384_N.webp', 'Design a logo that embodies the spirit of \'A Better Tomorrow.\' Use fonts and imagery that evoke optimism, growth, and positive change. Consider using a blend of handwritten script or modern serif fonts to emphasize a personal yet professional touch. Incorporate elements that symbolize progress and transformation, such as upward arrows, open pathways, or dynamic shapes. Prioritize a clean and minimalist design that communicates clarity and a bright future.', 19369472, 1687012973309075458, 'N', 'eeca3055-faf3-432b-8b6c-e60d71a1800f', 'SYS');
