INSERT INTO `df_drawing_example` VALUES (1726982937510940674, 0, '2023-11-21 23:16:33', '2023-11-21 23:16:33', 'https://cdn.midjourney.com/0cdedc28-92cd-4747-8e49-40dd03ca3d51/0_0.webp', 'https://cdn.midjourney.com/0cdedc28-92cd-4747-8e49-40dd03ca3d51/0_0_384_N.webp', '1. Incorporate a classic game controller or joystick in the design. 2. Create a pixelated character or mascot inspired by popular video game aesthetics. 3. Combine elements from different game genres, like a sword and a spaceship, to represent variety. 4. Use a speech bubble with gaming-related text, like “Game On!” or “Level Up!” 5. Design a logo that resembles a game cartridge, with the channel’s name on it. 6. Feature iconic game elements like power-ups, coins, or health bars. 7. Showcase a dynamic action shot of a character from a well-known game. 8. Play with retro arcade-style fonts and neon colors for a nostalgic feel. 9. Illustrate a scene of a player and their avatar, highlighting the connection between gamers and their in-game characters. 10. Integrate a play button symbol with gaming elements to emphasize the channel’s focus on videos.', 18846031, 1687012973309075458, 'N', '31dfb2c8-c3f8-43e5-a8d3-a96ea79ed962', 'SYS');
