INSERT INTO `df_drawing_example` VALUES (1726984747961290773, 0, '2023-11-21 23:23:44', '2023-11-21 23:23:44', 'https://cdn.midjourney.com/becd0072-bdcc-40a3-8936-5c2b650c1288/0_0.webp', 'https://cdn.midjourney.com/becd0072-bdcc-40a3-8936-5c2b650c1288/0_0_384_N.webp', 'Create an Architectural Design Portfolio page that measures 11 inches by 17 inches for a modern style villa. Focus on a style that incorporates clean lines and a modern aesthetic. Use a color palette that features earthy tones such as greens and browns to evoke a sense of nature and sustainability. Integrate architectural drawings created with Autodesk AutoCAD, including floor plans, elevations, and sections, to showcase the design process. Choose a font that is simple and easy to read, such as Helvetica, and experiment with different font sizes and weights to add hierarchy to the page. Finally, use repetition and patterns to create visual interest. --s 50', 20701004, 1687012973309075458, 'N', '566ac951-5154-48cb-893e-cce3bd7b3942', 'SYS');
INSERT INTO `df_drawing_example` VALUES (1726984747961290774, 0, '2023-11-21 23:23:44', '2023-11-21 23:23:44', 'https://cdn.midjourney.com/1fa91ece-4f51-49b2-9e0e-640d8f5d813e/0_0.webp', 'https://cdn.midjourney.com/1fa91ece-4f51-49b2-9e0e-640d8f5d813e/0_0_384_N.webp', 'draw a presentation for a design and construction company --v 5.2', 19848868, 1687012973309075458, 'N', 'a5ae8f84-7b6f-4c7b-8cf5-37b85e7476a8', 'SYS');
INSERT INTO `df_drawing_example` VALUES (1726984747961290775, 0, '2023-11-21 23:23:44', '2023-11-21 23:23:44', 'https://cdn.midjourney.com/697c91b2-2ec4-450c-a52c-702bda9aea7f/0_0.webp', 'https://cdn.midjourney.com/697c91b2-2ec4-450c-a52c-702bda9aea7f/0_0_384_N.webp', 'Title: Building Design and Construction Phases 1. Predesign Feasibility assessments, brief reviews, site inspections, and analyses. Deliverables: Preliminary envelope massing, site constraint diagrams. 2. Schematic (concept) design Sketches, preliminary furniture layouts, material selection, and consultant coordination. Deliverables: Site plan, spatial diagrams, floor plans, sections, elevations, project data, finishes boards, and potential 3D views and reports. 3. Design development (detailed design) Design finalization, material schedules, consultant info integration, and planning approval. Deliverables: Detailed floor plans, sections, elevations, space data, 3D views, and reports. 4. Documentation Detailed design review, construction certificate documentation, consultant coordination, and pre-tender estimates. Deliverables: Detailed site plans, floor plans, sections, elevations, fittings, consultant drawings, specifications, and pre-tender estimates. 5. Contractor selection (tender) Tender processes, issue sets, tender assessments, and negotiations. Deliverables: Tender sets, additional details, site reports, and defects schedules. 6. Contract administration and post-contract Document issuance, site visits, contractor instruction, defects assessments, and completions. Deliverables: Contract documents, observation reports, clarification details, defects reports, completion certificates. Objective: Create a comprehensive visual representation of the building design and construction phases, emphasizing the process flow and deliverables.', 20094290, 1687012973309075458, 'N', 'ba8b64c0-a234-48f6-9c42-5dca03bc0ea2', 'SYS');
